import UseStateCards from './usestatecards'




function App() {

    const[text, setText] = useState("5 birthdays today");

    const handleClick = () => {
      if (text === "5 birthdays today"){
        setText ("0 birthdays today");
      } else {
        setText ("5 birthdays today");
      }
    };

  return (

    <div className="parent">
      <div className="container">
        <h2>{ text }</h2> 
        <UseStateCards />

        <button className="bton" onClick={handleClick}></button>
      </div>
    </div>
  );
}

export default App;
